import React, { useState } from "react";
import Ball from "../assets/images/ball-logo.svg";

function Navbar() {
    return (
        <div className="navbar">
            <div className="nav-logo">
                <img id="ball-logo" src={Ball} alt="Ball Logo" />
                <h2 className="nav-title">Power Up</h2>
            </div>
            <nav className="desktop">
                <a href="#">Overview</a>
                <a href="#">Partners</a>
                <a href="#">Benefits</a>
                <a href="#">FAQ</a>
                <a href="#">Apply Here</a>
            </nav>
        </div>
    );
}

export default Navbar;
